import './MovieRow.css'

export default ({title, items}) => {
    return (
        <div>
            <h2>
                {title}
                <div className="MovieRow--listarea">
                    {items.results.lengh > 0 && items.result.map}
                </div>
            </h2>
        </div>
    )
}
